import * as React from 'react';
import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import ChillImage from "../images/chilldood.png";

const Item = styled(Paper)(({ theme }) => ({
  textAlign: 'center',
}));

function Chill() {
  // Import result is the URL of your image
  return <img src={ChillImage} alt="Dood Chills" />;
}

export default function BasicGrid() {
  return (
      <Grid container spacing={2} style={{ height: "auto", display: "flex", backgroundColor: "#384885", padding: "40px"}}>
        <Grid item xs={ 12 } md= {6}>
          <Item elevation={2} style={{backgroundColor: "#24305e", color: "#ffffff", minHeight:"600px", padding: "40px"}}>
            <h1 style={{ display: "flex", justifyContent: "left",}}>Welcome to the Good Doods Club </h1>
            <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify", fontSize:"18px"}}> The Good Doods Club is for Good Doods who want to Do Good. Our initial Do Good Project will generate ~$12.5m for cancer research and over 5000 gifts for children at St Jude.</h2>
            <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}> <a href="https://docs.google.com/document/d/1rJJiP92-weUg_fJ4d0Wtjz2HwFzRmMgY_VLN-oc5_pI/edit?usp=sharing" target="_blank"> Read the Whitepaper</a></h2>
            <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}> Our Do Good Model will perpetually fund gift giving and we will expand our approach to continuing making life better here on earth.</h2>
            <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>Good Doods deserve a pat on the back for Doing Good. Each quarter 250 Good Doods will be randomly selected and will receive the items featured in the NFTs they hold. This will ensure that rare Doods hold their value over time.</h2>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>5,000 Good Dood Members </h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>25 SOL Club Membership Fee </h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>75k SOL to St. Jude</h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>5000+ gifts delivered to St Jude Patients </h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>250+ gifts delivered to the Good Doods Club Members </h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>50% of resale commission re-enters Do Good Project Pool</h1>
          </Item>
        </Grid>
        <Grid item xs={12} md={6}>
          <Item elevation={0}  style={{backgroundColor: "#384885"}}>

          <img src={ChillImage} alt="Logo"
            style={{
              maxWidth: "100%",
              minWidth: "300px",
              height: "auto",
              marginLeft: "20px",
          }}
          />

          </Item>
        </Grid>
      </Grid>
  );
}
